import React, {useEffect,useState}from 'react';
import InventoriesList from './InventoriesList';


function Products({Inventories}) {
  const [isInventories,setIsInventories]=useState([]);


  useEffect(()=>{
    fetch('https://nameless-retreat-54870.herokuapp.com/inventories')
    .then(res=>res.json())
    .then(data=>setIsInventories(data))
  },[])
  return (
    <InventoriesList isInventories={Inventories}/>
  )
}

export default Products
